import Http from "utils/Http";
import {
  requestSignIn,
  signIn,
  failSignIn,
  signOut,
  setUser
} from "./store/actionCreators";

export function signup(params) {
  return dispatch => {
    return Http.post("/users/sign-up", { ...params })
      .then(response => {
        console.log(response);
      })
      .catch(error => console.log(error));
  };
}
